import { Hits } from "react-instantsearch";


function Hit({ hit }) {
    return (
      <div>
        <h2>{hit.name}</h2>
        <p>{hit.description}</p>
        {hit.image && <img src={hit.image} alt={hit.name} style={{ width: '100px', height: '100px' }} />}
      </div>
    );
  }


function Results() {
    return (
        <Hits hitComponent={Hit} />
    );
    }

export default Results;
